import React from 'react'
import { ListaTiposComponentes } from '../components/ListaTiposComponentes.jsx'

function App() {
  return (
    <div>
      <input type="text" placeholder="Nome do Componente"/>
      <textarea placeholder="Descrição do componente"/>
      <button>Inserir Componente</button>
      <ListaTiposComponentes/>
    </div>
  );
}

export default App;
